import San_Pham from "./San_Pham";

function Loai_San_Pham(truyen)
{
    const ListSP = truyen.data.ds_san_pham.map(function(item){
        return(
            <San_Pham data={item}/>
        );
    });

    return (
        <>
        <h1>{ truyen.data.ten}</h1>
        <div>{ListSP}</div>
        </>
    );

}

export default Loai_San_Pham;
